  false,\n\t\"url\": null,\n\t\"notes\": \"The TIGER/Line Files are shapefiles and
  related database files (.dbf) that are an extract of selected geographic and cartographic
  information from the U.S. Census Bureau's Master Address File / Topologically Integrated
  Geographic Encoding and Referencing (MAF/TIGER) Database (MTDB). The MTDB represents
  a seamless national file with no overlaps or gaps between parts, however, each TIGER/Line
  File is designed to stand alone as an independent data set, or they can be combined
  to cover the entire nation. Census Blocks are statistical areas bounded on all sides
  by visible features, such as streets, roads, streams, and railroad tracks, and/or
  by nonvisible boundaries such as city, town, township, and county limits, and short
  line-of-sight extensions of streets and roads. Census blocks are relatively small
  in area; for example, a block in a city bounded by streets. However, census blocks
  in remote areas are often large and irregular and may even be many square miles
  in area. A common misunderstanding is that data users think census blocks are used
  geographically to build all other census geographic areas, rather all other census
  geographic areas are updated and then used as the primary constraints, along with
  roads and water features, to delineate the tabulation blocks. As a result, all 2010
  Census blocks nest within every other 2010 Census geographic area, so that Census
  Bureau statistical data can be tabulated at the block level and aggregated up to
  the appropriate geographic areas. Census blocks cover all territory in the United
  States, Puerto Rico, and the Island Areas (American Samoa, Guam, the Commonwealth
  of the Northern Mariana Islands, and the U.S. Virgin Islands). Blocks are the smallest
  geographic areas for which the Census Bureau publishes data from the decennial census.
  A block may consist of one or more faces. Block10Pop_pnt contains a centroid of
  every census block. It is a derivative product of the polygon layer Block10Pop.
  This census data layer has been imported into the Miami-Dade County ArcSDE infrastructure
  and re-projected to: Projected Coordinate System: NAD_1983_StatePlane_Florida_East_FIPS_0901_Feet
  Projection: Transverse_Mercator False_Easting: 656166.66666667 False_Northing: 0.00000000
  Central_Meridian: -81.00000000 Scale_Factor: 0.99994118 Latitude_Of_Origin: 24.33333333
  Linear Unit: Foot_US Population figures have been appended to the end of the feature
  classes attribute table: Pop2010, HU2010, HISPAN, WHITENH, BLACKNH, AMERINDIANNH,
  ASIANNH, HAWIANNH, OTHERNH, and MULTIRACE. Definitions can be found in the census
  documentation.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"responsible-party\",\n\t\t\"value\":
